        super(props);

        this.state = {
        };
    }

    render(){
        return(<Box
            border={{
                "color": "border",
                "size": "medium",
                "style": "dashed",
                "side": "all"
              }}>
            <h1>Hi I am the minimap component</h1>
        </Box>)
